#include <stdio.h>
#include <stdlib.h>
#include <string.h>

/***********************************************************************/
/* Given a string, find the length of the longest substring without    */
/* repeating characters.                                               */
/*                                                                     */
/* Examples:                                                           */
/* Given "abcabcbb", the answer is "abc", which the length is 3.       */
/* Given "bbbbb", the answer is "b", with the length of 1.             */
/* Given "pwwkew", the answer is "wke", with the length of 3.          */
/* Note that the answer must be a substring, "pwke" is a subsequence   */
/* and not a substring.                                                */
/*                                                                     */
/***********************************************************************/
int lengthOfLongestSubstring(char* s)
{
    int map[127] = {0};
    int i = 0, longest = 1, prev_loc, present_long = 0;

    /* Ensure sanity */
    if ((s == NULL) || (s[0] == '\0'))
        return 0;

    /* Loop checking for the best case where there are no repeating
       characters */
    for (i = 0; s[i] != '\0'; ++i)
    {
        /* If it's a repeating character, then break */
        if (map[(int)s[0]] != 0)
            break;

        /* Record the location of the repeating character */
        map[(int)s[0]] = i + 1;
        present_long++;
    }

    /* Loop seeking the substring */
    while (s[i] != '\0')
    {
        /* Get the previous location of the character */
        prev_loc = map[(int)s[i]] - 1;

        /* increment sub-string length if it's the first instance of this
           character or if the previous location was before the start of
           the present substring. */
        if (prev_loc < (i - present_long))
            present_long++;

        /* Else we need to adjust the sub-string length */
        else
        {
            /* If the present length is the longest, then record the
               same */
            if (present_long > longest)
                longest = present_long;

            /* Reduce the present length depending on the previous
              location */
            present_long = i - prev_loc;
        }

        /* Update the previous location for that character, note that
           we add 1 */
        map[(int)s[i]] = i + 1;
        ++i;
    }

    /* If the longest sub-string was at the end, then update the length */
    if (present_long > longest)
        longest = present_long;

    /* Return */
    return longest;
}

